        [TestMethod]
        public void viewTest()
        {
            // >>> x = torch.randn(4, 4)
            // >>> x.size()
            // torch.Size([4, 4])
            // >>> y = x.view(16)
            // >>> y.size()
            // torch.Size([16])
            // >>> z = x.view(-1, 8)  # the size -1 is inferred from other dimensions
            // >>> z.size()
            // torch.Size([2, 8])
            // 
            // >>> a = torch.randn(1, 2, 3, 4)
            // >>> a.size()
            // torch.Size([1, 2, 3, 4])
            // >>> b = a.transpose(1, 2)  # Swaps 2nd and 3rd dimension
            // >>> b.size()
            // torch.Size([1, 3, 2, 4])
            // >>> c = a.view(1, 3, 2, 4)  # Does not change tensor layout in memory
            // >>> c.size()
            // torch.Size([1, 3, 2, 4])
            // >>> torch.equal(b, c)
            // False
            // 

#if TODO
            var given=  x = torch.randn(4, 4);
             given=  x.size();
            var expected=
                "torch.Size([4, 4])";
            Assert.AreEqual(expected, given.repr);
             given=  y = x.view(16);
             given=  y.size();
             expected=
                "torch.Size([16])";
            Assert.AreEqual(expected, given.repr);
             given=  z = x.view(-1, 8)  # the size -1 is inferred from other dimensions;
             given=  z.size();
             expected=
                "torch.Size([2, 8])\n" +
                "";
            Assert.AreEqual(expected, given.repr);
             given=  a = torch.randn(1, 2, 3, 4);
             given=  a.size();
             expected=
                "torch.Size([1, 2, 3, 4])";
            Assert.AreEqual(expected, given.repr);
             given=  b = a.transpose(1, 2)  # Swaps 2nd and 3rd dimension;
             given=  b.size();
             expected=
                "torch.Size([1, 3, 2, 4])";
            Assert.AreEqual(expected, given.repr);
             given=  c = a.view(1, 3, 2, 4)  # Does not change tensor layout in memory;
             given=  c.size();
             expected=
                "torch.Size([1, 3, 2, 4])";
            Assert.AreEqual(expected, given.repr);
             given=  torch.equal(b, c);
             expected=
                "False";
            Assert.AreEqual(expected, given.repr);
#endif
        }

